import './App.css';
import Footer from './components/footer/Footer';
import Header from './components/header/Header';
import Home from './pages/Home';


function App() {
  return (
    <>
      <Header/>
      <Router>
        <Routes>
          <Route path="" element={<Home />} />
        </Routes>
      </Router>
      <h1 className="text-6xl font-bold underline">
        Hello world!
      </h1>
      <Footer/>
    </>
  );
}

export default App;
